import React from 'react';
import classes from "./ProfileInfo.module.css";

const ProfileInfo = () => {
  return (
    <div>
      <div className={classes.background}>
        <img src="data:image/jpeg;base64," alt="ava"></img>
      </div>
      <div>
        <img src="https://sun9-37.userapi.com/c628321/v628321677/3bc35/Nw-jx5UJK5k.jpg" alt="ava" className={classes.avatar}></img>
        <span className={classes.profileName}>Klymenko Iryna</span>
      </div>
    </div>
  );
}

export default ProfileInfo;
